function HomePage(){
    return (
    <div className="App">
    <div id="body">
    <Burger />
    <Nav />
    <main>
        <header role="banner">
            <h1 className="header">ROSS MACDONALD</h1>
            <h2 className="header">full stack web developer in the Portland metro area</h2>
        </header>  
    </main>
    <Footer />
    </div>
    </div>
    )
}
export default HomePage
